import styled from 'styled-components';

const Wrapper = styled.div`

  @media(min-width: 1024px) {
    border: 6px solid #373739;
    margin: 32px 140px;
    border-radius: 8px;
  }
`;

const Header = styled.p`
  font-size: 32px;
  color: #373739;
  font-weight: bold;
  text-align: center;

  @media(min-width: 1024px) {
    font-size: 54px;
  }
`;

export {
  Wrapper,
  Header
};
